    ///  <span class="type"><a href="http://doc.qt.io/qt-5/qtglobal.html#uint-typedef">uint</a></span> <a href="http://doc.qt.io/qt-5/qhash.html#qHashx">qHash</a>(<span class="keyword">const</span> K <span class="operator">&amp;</span>key);
